    const api_oyuncu=`https://cryptic-gorge-72989.herokuapp.com/players/${id}`
    axios.get(api_oyuncu)
        .then(response=>{
            setOyuncu(response.data)
        },[id])

    return(
        <div>

        </div>
    )
}

